INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (44, 155, "東山奈央", 8, 16, 100101, "人助け、応援", "A", "トゥインクルウィッシュ", 2, 0, 27, "人助けが大好き！　前向き格闘娘", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ", "獣人族");
