INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (46, 163, "早見沙織", 1, 18, 100301, "読書、乗馬、お茶", "B", "トゥインクルウィッシュ", 2, 0, 12, "クールで何事にも真っ直ぐな剣士", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (27, 128, "諸星すみれ", 8, 9, 100401, "いたずら、探検", "O", "リトルリリカル", 5, 0, 10, "探検好きのイタズラっ子", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ミソギ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 146, "下田麻美", 11, 12, 100501, "ヒーローごっこ", "O", "王宮騎士団（NIGHTMARE）", 8, 0, 25, "ヒーローに憧れる騎士見習いの少女", "？？？", "マツリ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (42, 150, "浅倉杏美", 11, 13, 100601, "サックス", "O", "悪魔偽王国軍（ディアボロス）", 7, 0, 22, "甘え上手なみんなの人気者", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "アカリ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (32, 130, "雨宮天", 1, 14, 100701, "プリンを食べること", "B", "悪魔偽王国軍（ディアボロス）", 7, 0, 23, "プリン大好きゴースト娘", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 150, "大空直美", 10, 14, 100801, "鏡で自分を見ること", "AB", "ヴァイスフリューゲル　ランドソル支部", 15, 0, 10, "ボクは誰よりも美しい", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ", "エルフ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (45, 159, "髙野麻美", 7, 17, 100901, "小説執筆", "A", "トワイライトキャラバン", 13, 0, 5, "前世を信じる中二病患者、「疾風の冥姫」", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "アンナ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (42, 155, "内田真礼", 9, 16, 101001, "空想、ぬいぐるみ集め", "O", "自警団（カォン）", 10, 0, 22, "マホマホ王国のプリンセス", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (44, 156, "阿澄佳奈", 8, 15, 101101, "お裁縫", "A", "ラビリンス", 3, 0, 25, "人懐っこくてマシンガントークな妹系少女", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "リノ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (46, 156, "大橋彩香", 12, 17, 101201, "妹と遊ぶこと、二度寝、昼寝、早寝", "A", "フォレスティエ", 6, 0, 24, "みんなのために超能力を使う眠り姫", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "ハツネ", "エルフ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (55, 166, "佳村はるか", 8, 18, 101301, "読書、魔法", "O", "トワイライトキャラバン", 13, 0, 21, "オタク全開な魔法少女", "", "ナナカ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (41, 152, "水瀬いのり", 11, 15, 101401, "読書、推理", "AB", "自警団（カォン）", 10, 0, 3, "頭脳明晰な美少女名探偵", "test", "カスミ", "獣人族");
