INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (48, 167, "上坂すみれ", 4, 18, 101601, "ファッション", "O", "ルーセント学院", 14, 0, 10, "天真爛漫で人気者のカリスマモデル", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "スズナ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (53, 158, "高森奈津美", 7, 19, 101701, "踊り、空手", "A", "自警団（カォン）", 10, 0, 7, "いつでも「なんくるないさ～」な天然娘", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "カオリ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (52, 162, "伊藤静", 8, 23, 101801, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "B", "ルーセント学院", 14, 0, 14, "多くの男性を魅了する無垢な女教師", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "イオ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (21, 117, "日高里菜", 4, 10, 102001, "かわいいもの集め", "O", "リトルリリカル", 5, 0, 3, "お歌もにんじんも、ウサギさんも大好き♪", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "ミミ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 150, "植田佳奈", 6, 12, 102101, "観劇、おままごと", "B", "サレンディア救護院", 9, 0, 9, "泣き虫で臆病な守ってあげたい女の子", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 150, "原紗友里", 11, 13, 102201, "ゲーム全般", "O", "悪魔偽王国軍（ディアボロス）", 7, 0, 22, "人見知りであまのじゃくな女の子", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ヨリ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (38, 148, "芹澤優", 5, 14, 102301, "屋内でできる遊び", "B", "サレンディア救護院", 9, 0, 10, "ぷうきちといつも一緒！", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (43, 154, "悠木碧", 12, 15, 102501, "ご奉仕", "O", "サレンディア救護院", 9, 0, 12, "お嬢さまのためにがんばるドジっ娘メイド", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (42, 144, "小岩井ことり", 1, 17, 102601, "あんパン", "B", "牧場（エリザベスパーク）", 11, 0, 1, "遊びと睡眠が何より大事なぐうたら娘", "test", "リン", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (43, 154, "橋本ちなみ", 7, 16, 102701, "実験、裁縫、料理", "B", "トワイライトキャラバン", 13, 0, 30, "運命の相手に一途すぎる乙女", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (43, 156, "堀江由衣", 10, 17, 102801, "経営、お茶会", "A", "サレンディア救護院", 9, 0, 4, "救護院を経営する優しい庶民派お嬢様", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレン", "エルフ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 157, "日笠陽子", 1, 17, 102901, "舞台鑑賞、ダンス", "B", "カルミナ", 4, 0, 24, "歌って踊れる大人気アイドル", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ノゾミ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (51, 163, "佐藤聡美", 8, 16, 103001, "忍法開発", "O", "ヴァイスフリューゲル　ランドソル支部", 15, 0, 31, "トーゴクの神秘、オシエテクダサイ！", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (42, 157, "大坪由佳", 12, 18, 103101, "占い", "AB", "悪魔偽王国軍（ディアボロス）", 7, 0, 22, "占いが得意な霊能少女", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (45, 157, "松嵜麗", 3, 18, 103201, "慈善事業", "AB", "メルクリウス財団", 12, 0, 12, "一人前の商人を目指すパワフルお嬢様", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "アキノ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (35, 142, "新田恵海", 3, 20, 103301, "漫才", "B", "牧場（エリザベスパーク）", 11, 0, 3, "みんなを笑顔にするお笑い牧場主", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "マヒル", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (55, 164, "今井麻美", 3, 22, 103401, "ウインドーショッピング", "A", "メルクリウス財団", 12, 0, 16, "純情でほっとけない大人の女性", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ユカリ", "エルフ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (21, 118, "小倉唯", 2, 8, 103601, "お勉強", "A", "リトルリリカル", 5, 0, 2, "礼儀正しくしっかり者のちびっ子優等生", "test", "キョウカ", "エルフ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (43, 149, "茅原実里", 8, 13, 103701, "剣術、年長者をからかう", "A", "王宮騎士団（NIGHTMARE）", 8, 0, 11, "義理堅くてからかい好きな剣術少女", "test", "トモ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 153, "小清水亜美", 11, 14, 103801, "読書、お散歩", "A", "牧場（エリザベスパーク）", 11, 0, 3, "読書が趣味の病弱少女", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "シオリ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (44, 158, "花澤香菜", 6, 13, 104001, "友達作りのイメトレ", "AB", "フォレスティエ", 6, 0, 6, "「友達」に憧れる、エルフの森の女の子", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "アオイ", "エルフ");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (46, 163, "福原綾香", 6, 17, 104201, "各種楽器", "O", "カルミナ", 4, 0, 3, "人々を守るために歌う、唱喚士の少女", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (54, 168, "小松未可子", 8, 17, 104301, "お菓子作り", "O", "自警団（カォン）", 10, 0, 9, "男勝りで情に厚いワイルド娘", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "マコト", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (50, 172, "丹下桜", 5, "??", 104401, "世界征服", "A", "悪魔偽王国軍（ディアボロス）", 7, 0, 5, "かつては夜を支配した最強の吸血鬼", "test", "イリヤ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (49, 157, "長妻樹里", 11, 18, 104501, "小説を読むこと", "AB", "ヴァイスフリューゲル　ランドソル支部", 15, 0, 19, "妄想大好き！　ほんとは照れ屋な女の子", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "クウカ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (48, 158, "沼倉愛美", 3, 18, 104601, "猫とたわむれること", "AB", "メルクリウス財団", 12, 0, 1, "弱きを助け強きをくじく猫娘", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (50, 171, "川澄綾子", 10, 25, 104701, "格闘技、湯浴み", "A", "王宮騎士団（NIGHTMARE）", 8, 0, 25, "素顔を見せない冷静沈着な女性騎士", "？？？", "ジュン", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (49, 163, "田所あずさ", 11, 20, 104801, "傭兵などのアルバイト", "O", "メルクリウス財団", 12, 0, 11, "仕事も私事も効率優先な傭兵少女", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (54, 168, "生天目仁美", 10, 18, 104901, "家事全般", "O", "ラビリンス", 3, 0, 24, "お姉ちゃんがお世話してあげるからねっ！", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, 120, "久野美咲", 1, 11, 105001, "ファッション誌鑑賞、コスメ集め", "A", "ルーセント学院", 14, 0, 3, "ちょっとおませな恋に恋する女の子", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (53, 166, "三石琴乃", 3, 27, 105101, "研究、実験", "A", "トワイライトキャラバン", 13, 0, 7, "実験が趣味の危険な科学者", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ミツキ", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (100, 150, "徳井青空", 3, 18, 105201, "毛繕い、お喋り", "A", "牧場（エリザベスパーク）", 11, 0, 14, "乙女チックなもふもふアニマル", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "リマ", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (33, 140, "辻あゆみ", 7, 18, 105301, "お菓子屋通い", "A", "ヴァイスフリューゲル　ランドソル支部", 15, 0, 28, "見た目も中身もお子ちゃまな異国の軍人", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "モニカ", "ヒューマン");
