INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (42, 157, "大坪由佳", 12, 18, 108101, "占い", "AB", "悪魔偽王国軍（ディアボロス）", 7, 0, 22, "占いが得意な霊能少女", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ（ハロウィン）", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (32, 130, "雨宮天", 1, 14, 108201, "プリンを食べること", "B", "悪魔偽王国軍（ディアボロス）", 7, 0, 23, "プリン大好きゴースト娘", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ（ハロウィン）", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, 120, "久野美咲", 1, 11, 108301, "ファッション誌鑑賞、コスメ集め", "A", "ルーセント学院", 14, 0, 3, "ちょっとおませな恋に恋する女の子", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ（ハロウィン）", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (46, 163, "福原綾香", 6, 17, 108401, "各種楽器", "O", "カルミナ", 4, 0, 3, "人々を守るために歌う、唱喚士の少女", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（クリスマス）", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (40, 150, "植田佳奈", 6, 12, 108501, "観劇、おままごと", "B", "サレンディア救護院", 9, 0, 9, "泣き虫で臆病な守ってあげたい女の子", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ（クリスマス）", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (38, 148, "芹澤優", 5, 14, 108601, "屋内でできる遊び", "B", "サレンディア救護院", 9, 0, 10, "ぷうきちといつも一緒！", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ（クリスマス）", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (44, 155, "東山奈央", 8, 16, 108701, "人助け、応援", "A", "トゥインクルウィッシュ", 2, 0, 27, "人助けが大好き！　前向き格闘娘", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（ニューイヤー）", "獣人族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (47, 158, "種田梨沙", 4, 17, 108801, "料理、人間観察", "O", "トゥインクルウィッシュ", 2, 0, 5, "戦闘のサポートが得意な、心優しい少女", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（ニューイヤー）", "ヒューマン");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (46, 163, "早見沙織", 1, 18, 108901, "読書、乗馬、お茶", "B", "トゥインクルウィッシュ", 2, 0, 12, "クールで何事にも真っ直ぐな剣士", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（ニューイヤー）", "魔族");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (43, 154, "橋本ちなみ", 7, 16, 109001, "実験、裁縫、料理", "B", "トワイライトキャラバン", 13, 0, 30, "運命の相手に一途すぎる乙女", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（バレンタイン）", "魔族");
