INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (67, 167, "福原綾香", 11, 17, 109401, "ピアノ", "B", "？？？", "", 0, 3, "人を超越した力を有す心優しい竜姫", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "グレア", "半人半竜");
